#include "common.hpp"

// Note, we could also use the functions from GLM but we write the transformations here to show the uderlying math
void Transform::scale(vec2 scale)
{
	mat3 S = { { scale.x, 0.f, 0.f },{ 0.f, scale.y, 0.f },{ 0.f, 0.f, 1.f } };
	mat = mat * S;
}

void Transform::rotate(float radians)
{
	float c = cosf(radians);
	float s = sinf(radians);
	mat3 R = { { c, s, 0.f },{ -s, c, 0.f },{ 0.f, 0.f, 1.f } };
	mat = mat * R;
}

void Transform::translate(vec2 offset)
{
	mat3 T = { { 1.f, 0.f, 0.f },{ 0.f, 1.f, 0.f },{ offset.x, offset.y, 1.f } };
	mat = mat * T;
}

// number of combinations (n choose k)
// https://stackoverflow.com/questions/15301885/best-way-of-calculating-n-choose-k
int choose(int n, int k) {
	if (k == 0) return 1;
	return (n * choose(n - 1, k - 1)) / k;
}

bool gl_has_errors()
{
	GLenum error = glGetError();

	if (error == GL_NO_ERROR) return false;

	while (error != GL_NO_ERROR)
	{
		const char* error_str = "";
		switch (error)
		{
		case GL_INVALID_OPERATION:
			error_str = "INVALID_OPERATION";
			break;
		case GL_INVALID_ENUM:
			error_str = "INVALID_ENUM";
			break;
		case GL_INVALID_VALUE:
			error_str = "INVALID_VALUE";
			break;
		case GL_OUT_OF_MEMORY:
			error_str = "OUT_OF_MEMORY";
			break;
		case GL_INVALID_FRAMEBUFFER_OPERATION:
			error_str = "INVALID_FRAMEBUFFER_OPERATION";
			break;
		}

		fprintf(stderr, "OpenGL: %s", error_str);
		error = glGetError();
		assert(false);
	}

	return true;
}

bool collidesWithWallX(vec2 pos, int offset) {
	int xCoord = (int)pos.x / 100;
	return GAME_MAZE[(int)(pos.y - offset) / 100][xCoord] || GAME_MAZE[(int)(pos.y + offset) / 100][xCoord];
}

bool collidesWithWallY(vec2 pos, int offset) {
	int yCoord = (int)pos.y / 100;
	return GAME_MAZE[yCoord][(int)(pos.x - offset)/100] || GAME_MAZE[yCoord][(int)(pos.x + offset) / 100];
}

